import 'package:tonic/tonic.dart';

import 'modals/pitch_chord.dart';
import 'modals/progression/chord_progression.dart';
import 'modals/progression/degree_progression.dart';
import 'modals/theory_base/pitch_scale.dart';

void main() {
  print(DegreeProgression.fromChords(
      PitchScale.common(tonic: Pitch.parse('C')),
      ChordProgression(
        chords: [
          PitchChord.parse('C'),
          PitchChord.parse('G'),
          PitchChord.parse('C'),
          PitchChord.parse('G'),
          PitchChord.parse('C'),
          PitchChord.parse('G'),
          PitchChord.parse('C'),
          PitchChord.parse('G'),
          PitchChord.parse('C'),
          PitchChord.parse('Dm'),
          PitchChord.parse('G'),
          PitchChord.parse('C'),
          PitchChord.parse('G'),
          PitchChord.parse('C'),
          PitchChord.parse('G'),
          PitchChord.parse('C'),
          PitchChord.parse('G'),
          PitchChord.parse('C'),
        ],
        durations: [
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 8 * 2,
          1 / 8 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 4 * 2,
          1 / 8 * 2,
          1 / 8 * 2,
          1 / 4 * 2,
        ],
      )));

  final r1 = _sortResult(more);
  final r2 = _sortResult(less);

  for (int i = 0; i < 3; i++) {
    final part1 = r1[i];
    final part2 = r2[i];

    part1
        .where((element) => !part2.contains(element))
        .forEach((element) => print(element.trim()));
    print('--------');
  }
}

List<List<String>> _sortResult(String result) {
  result = result.trim();
  final s = result.split(r"--DONE--");
  final List<List<String>> r = [];
  for (var part in s) {
    part = part
        .replaceAll(r'[', '')
        .replaceAll(r']', '')
        .replaceAll('|, |', '|@ |');
    r.add(part.split(r'@'));
  }
  return r;
}

